import '../App.css';
import styled from "styled-components";
import Header from "../header/Header";

const Main = styled.div`
  background-color: black;
  width: 100%;
  height: 100%;
`

const Dashboard = () => {
  return (
    <Main>
      <Header />
    </Main>
  );
}

export default Dashboard;
